import React, {useState} from 'react';
import layer_cake from '../picture/layer-cake.jpg'
import birthday_cake from '../picture/birthday-cake.jpg'
import cup_cake from '../picture/cup-cake.jpg'


const cake_types = {
    layer_cake: layer_cake,
    birthday_cake: birthday_cake,
    cup_cake: cup_cake
};

const cake_descs = {
    layer_cake: 'LAYER CAKE',
    birthday_cake: 'BIRTHDAY CAKE',
    cup_cake: 'CUP CAKE'
}


class Category extends React.Component{

    render(){

        return(
            <div className="category">
                <img className="category-picture" src={cake_types[this.props.type]}/>
        <div className="category-desc">{cake_descs[this.props.type]}</div>
            </div>
        );
    }

}

export default Category;
